// WorkoutDetails.tsx
import { Button, Container, Typography } from '@mui/material';
import React from 'react';
import { useParams } from 'react-router-dom';

interface WorkoutDetailsProps {
  workoutName: string;
  onNextWorkout: () => void; // Callback function to handle going to the next workout
}

const WorkoutDetails: React.FC<WorkoutDetailsProps> = ({ workoutName, onNextWorkout }) => {
  const { workoutName: paramWorkoutName } = useParams<{ workoutName: string }>();

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      <Typography variant="h4" color="primary" gutterBottom>
        Workout Details
      </Typography>

      <Typography variant="h5" color="white" paragraph>
        Details for {paramWorkoutName}
      </Typography>

      {/* Include additional details or content for the workout as needed */}
      <Typography variant="body1" color="white" paragraph>
        Reps: 10 {/* Replace with the actual number of reps */}
      </Typography>

      {/* Add more workout details as needed */}

      <Button variant="contained" size="large" color="primary" onClick={onNextWorkout}>
        Next Workout
      </Button>
    </Container>
  );
};

export default WorkoutDetails;
